    <div className="SignUp">
<form>
<button className="RegisterButton"> <Link to='/register'>Sign up ..5,6,7,8</Link></button>
<button  className="LoginButton"> <Link to='/login'> Login ..5,6,7,8</Link></button>
</form>
  </div>
)}

export default SignupForm;
